function App() {
  return (
    <center className="App">
      <h1>HAVE YOU SEEN THIS PERSON???</h1>
      <p>
        Greetings!<br/>
        This is a silly little webpage that I made to collect data for another project. I need a large database of named images and so I felt it would be fun to outsouce that using this-person-doesnt-exist.com api to collect that data.<br/>
        If you wouldn't mind filling out the form bellow a few times that would make my day :)<br/>
      </p>
    </center>
  );
}

export default App;
